import React from "react";
import Footer from "../Footer";
import Header from "../header";

import service10 from "../../assets/images/resource/service-10.png";
import design1 from "../../assets/images/resource/design-1.png";
import design2 from "../../assets/images/resource/design-2.png";
import { Link } from "react-router-dom";

export default function BusinessProcessOutsourcingservices() {
  return (
    <>
      <div class="page-wrapper">
        <Header />
        <section class="top-container banner-section-five">
          <div class="auto-container">
            <div class="row clearfix">
              <div class="content-column col-lg-6 col-md-12 col-sm-12">
                <div class="inner-column">
                  <p
                    style={{
                      position: "relative",
                      fontStyle: "normal",
                      fontWeight: "400",
                      fontSize: "20px",
                      paddingBottom: "5px",
                      marginBottom: "20px",
                      color: "#212529",
                      marginTop: "0",
                    }}
                  >
                    <span
                      style={{
                        content: "",
                        width: "35px",
                        height: "2px",
                        position: "absolute",
                        bottom: "-4px",
                        left: 0,
                        background: "#2569e6",
                        WebkitTransform: "translateY(-50%)",
                        transform: "translateY(-50%)",
                      }}
                    />
                    BPO
                  </p>
                  <h2>Excellence in Customer Care, Delivered</h2>
                  <div class="text">
                    Focus on growing your business, while we handle your core
                    processes
                  </div>
                  <a
                    href="#"
                    style={{ textDecoration: "none" }}
                    class="btn-style-one theme-btn"
                  >
                    Get a Proposal
                  </a>
                </div>
              </div>
              <div class="image-column col-lg-6 col-md-12 col-sm-12">
                <div class="inner-column">
                  <div class="image">
                    <img src={service10} alt="" />
                  </div>
                </div>
              </div>
            </div>
          </div>
        </section>

        <section class="service-section">
          &gt;{" "}
          <div class="container">
            <div class="offer-title">
              {" "}
              <h2 class="home-heading-two">We can help you</h2>{" "}
            </div>{" "}
            <div class="offer-cards">
              {" "}
              <div class="card">
                {" "}
                <img
                  alt="improve productivity"
                  nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/service-improve-productivity.svg"
                  class=" lazyloaded"
                  nitro-lazy-empty=""
                  id="NTIyOjE0Mw==-1"
                  src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/service-improve-productivity.svg"
                />
                <h3>Improve Productivity</h3>{" "}
                <p>
                  Our team will help you cut down processing times and increase
                  efficiency, while adhering to your values.
                </p>{" "}
              </div>{" "}
              <div class="card">
                {" "}
                <img
                  alt="Reduce Costs"
                  nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/service-reduce-costs.svg"
                  class=" lazyloaded"
                  nitro-lazy-empty=""
                  id="NTI3OjEyNw==-1"
                  src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/service-reduce-costs.svg"
                />
                <h3>Reduce Costs</h3>{" "}
                <p>
                  By removing the hassle of hiring and managing your own inhouse
                  teams, costs are significantly lowered.
                </p>{" "}
              </div>{" "}
              <div class="card">
                {" "}
                <img
                  alt="Gain Customer Satisfaction"
                  nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/service-gain-customers.svg"
                  class=" lazyloaded"
                  nitro-lazy-empty=""
                  id="NTMyOjE0Mw==-1"
                  src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/service-gain-customers.svg"
                />
                <h3>Gain Customer Satisfaction</h3>{" "}
                <p>
                  Our staff is highly trained to handle even the toughest
                  escalations and keep your customers happy.
                </p>{" "}
              </div>{" "}
              <div class="card">
                {" "}
                <img
                  alt="Cater to Changing Demands"
                  nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/service-cater-to-changing.svg"
                  class=" lazyloaded"
                  nitro-lazy-empty=""
                  id="NTM3OjE0NQ==-1"
                  src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/service-cater-to-changing.svg"
                />
                <h3>Cater to Changing Demands</h3>{" "}
                <p>
                  We offer flexible BPO engagement allowing you to get the
                  services you need whenever you need them.
                </p>{" "}
              </div>{" "}
              <div class="card">
                {" "}
                <img
                  alt="Core Business Activities"
                  nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/service-focus-core-business.svg"
                  class=" lazyloaded"
                  nitro-lazy-empty=""
                  id="NTQyOjE0Ng==-1"
                  src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/service-focus-core-business.svg"
                />
                <h3>Focus on Core Business Activities</h3>{" "}
                <p>
                  We help you focus on core business processes by taking care of
                  non essential tasks for you.
                </p>{" "}
              </div>{" "}
            </div>{" "}
            <div class="btn-wrap">
              {" "}
              <a href="#cta-dark" class="service-btn" id="tellusw-btn-trans">
                Tell Us What You Need <i class="la la-arrow-right"></i>
              </a>{" "}
            </div>{" "}
          </div>{" "}
        </section>

        <section class="experties nitro-offscreen">
          {" "}
          <div class="container">
            <div class="exprt-title">
              {" "}
              <h2 class="home-heading-two">Services We Offer</h2>{" "}
            </div>
            <div class="exprt-row">
              {" "}
              <div class="exprt-column">
                {" "}
                <div class="card c-typ3">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="Tech Support"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-tech-support.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NTYyOjEyNw==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-tech-support.svg"
                    />
                    <h4>Tech Support</h4>{" "}
                  </div>{" "}
                  <p>
                    Efficient and quick solutions for your customers technical
                    conundrums.
                  </p>{" "}
                </div>{" "}
              </div>{" "}
            </div>{" "}
            <div class="exprt-row m-center">
              {" "}
              <div class="exprt-column">
                {" "}
                <div class="card c-typ1">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="Tech Solutions"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-tech-solutions.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NTczOjEzMQ==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-tech-solutions.svg"
                    />
                    <h4>Tech Solutions</h4>{" "}
                  </div>{" "}
                  <p>
                    Specialized software development to improve efficiency of
                    workflows.
                  </p>{" "}
                </div>{" "}
                <div class="card c-typ1">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="Form Processing"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-form-processing.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NTgwOjEzMw==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-form-processing.svg"
                    />
                    <h4>Form Processing</h4>{" "}
                  </div>{" "}
                  <p>
                    Including customer surveys, requests, complaints, and
                    others.
                  </p>{" "}
                </div>{" "}
              </div>{" "}
              <div class="exprt-column">
                {" "}
                <div class="c-type-img">
                  {" "}
                  <img
                    alt="what we offer"
                    nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/what-we-offer.webp"
                    class=" lazyloaded"
                    nitro-lazy-empty=""
                    id="NTg4OjEyMg==-1"
                    src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/what-we-offer.webp"
                  />{" "}
                </div>{" "}
              </div>{" "}
              <div class="exprt-column">
                {" "}
                <div class="card c-typ2">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="Telemarketing"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-telemarketing.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NTk0OjEyOQ==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-telemarketing.svg"
                    />{" "}
                    <h4>Telemarketing</h4>{" "}
                  </div>{" "}
                  <p>Inbound and outbound to suit your prospecting demands.</p>{" "}
                </div>{" "}
                <div class="card c-typ2">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="IT HelpDesk"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-it-helpdesk.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NjAxOjEyNQ==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-it-helpdesk.svg"
                    />
                    <h4>IT HelpDesk</h4>{" "}
                  </div>{" "}
                  <p>
                    Addressing customer queries and enhancing their experience.
                  </p>{" "}
                </div>{" "}
              </div>{" "}
            </div>{" "}
            <div class="exprt-row">
              {" "}
              <div class="exprt-column">
                {" "}
                <div class="card c-typ1">
                  {" "}
                  <div class="card-title">
                    {" "}
                    <img
                      alt="Image Processing"
                      nitro-lazy-src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-image-processing.svg"
                      class=" lazyloaded"
                      nitro-lazy-empty=""
                      id="NjEyOjEzNQ==-1"
                      src="https://cdn-ddddj.nitrocdn.com/NSvsNMzbKkQslXvZnhobiTmmCkBXBUPd/assets/static/optimized/rev-9e570d1/wp-content/themes/tkxel/assets/images/bpo-image-processing.svg"
